import { Box, Container, Link, Typography } from "@mui/material";
import React from "react";
import { FlexBox } from "../../Components/Flexing";
import { FooterWrapper } from "./FooterWrapper";

export default function Footer() {
  return (
      <Container>
                <FlexBox flexDirection="column">
                        <img src="/images/logo1.png" width="150"/>
                        <Typography component="h3" variant = "body2">
                           What are the most popular Universities in the world?
                        </Typography>
                        <Link href="https://www.algorismic.uz/images/algorismic-02.svg">
                                <img src="/images/Algorismic.png" width="150"/>
                        </Link>
                </FlexBox>
      </Container>
  );
}


